import { Fragment } from "react";


const MessageList= ({messageList}, {user}) => {
    return (
        <div>
        {messageList.map((message, i) => (
            <Fragment class = "comment" key={i}><p>{message}<span>{user}</span></p></Fragment>
        ))}
        </div>
    );
};

export default MessageList;
